exports=async function(bid,options){const{parseUpdate}=await require("transcode/parse_update");return options?.blocked?parseUpdate(`https://www.silukex.com/ny${bid}/`,"meta",{clientOptions:{...(options&&options.clientOptions),"x-mobile":0}}):parseUpdate(`https://m.silukex.com/ny${bid}/`,"block_txt2",{clientOptions:{...(options&&options.clientOptions)}})};